pragma solidity ^0.8.0;

contract Healthcare {
    struct Patient {
        uint id;
        string name;
        uint age;
        string gender;
        string[] medicalRecords;
    }
    
    mapping (address => Patient) public patients;
    uint public patientCount;
    address public admin;

    constructor() {
        admin = msg.sender;
    }

    function addPatient(string memory _name, uint _age, string memory _gender) public {
        require(msg.sender == admin, "Only admin can add patients.");
        patientCount++;
        patients[msg.sender] = Patient(patientCount, _name, _age, _gender, new string[](0));
    }

    function addMedicalRecord(address _patientAddress, string memory _medicalRecord) public {
        require(msg.sender == _patientAddress, "Only patient can add medical records.");
        patients[_patientAddress].medicalRecords.push(_medicalRecord);
    }
    
    function getMedicalRecords(address _patientAddress) public view returns (string[] memory) {
        require(msg.sender == _patientAddress || msg.sender == admin, "Only patient or admin can view medical records.");
        return patients[_patientAddress].medicalRecords;
    }
}
